import styled from 'styled-components';

export const Section = styled.section`
    width: 100%;
    max-width: 400px;
   
    
    background: rgba(255,255,255,.95);
    border-radius: 10px;
    border-bottom: 10px solid #633BBC;
    margin-top: 15px;
    margin-bottom: 35px;

    @media (max-width: 435px ) {
        padding : 0 2rem 0 2rem;
    }
`
